In Godot Engine 3.x, the `KinematicBody` node is used to handle character movement, and it is a common node for first-person controllers. In Godot Engine 4.x, the `KinematicBody` node has been replaced with the `KinematicBody3D` node, which is used for 3D characters. Here's how you can write a first-person controller script in GDScript and apply it to a `KinematicBody3D` node in Godot Engine 4.x.

