@export var mouse_sensitivity: float = 0.2

var velocity: Vector3 = Vector3.ZERO
var input_direction: Vector3 = Vector3.ZERO
var rotation: Vector3 = Vector3.ZERO

func _ready():
    Input.set_mouse_mode(Input.MOUSE_MODE_CAPTURED)

func _process(delta: float) -> void:
    input_direction = Vector3.ZERO

    if Input.is_action_pressed("move_forward"):
        input_direction -= transform.basis.z
    if Input.is_action_pressed("move_backward"):
        input_direction += transform.basis.z
    if Input.is_action_pressed("move_left"):
        input_direction -= transform.basis.x
    if Input.is_action_pressed("move_right"):
        input_direction += transform.basis.x

    input_direction = input_direction.normalized()
    input_direction = input_direction * speed

    velocity = input_direction * delta

    rotation = Vector3(deg2rad(Input.get_axis("mouse_x", "mouse_y") * mouse_sensitivity), 0, 0)
    transform = transform.rotated(rotation)

    velocity = velocity * get_floor_normal()
    velocity = move_and_slide(velocity, Vector3.UP)

